/*Table structure for table `t_payment_bank_card_info` */

DROP TABLE IF EXISTS `t_payment_bank_card_info`;

CREATE TABLE `t_payment_bank_card_info` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `txnId` varchar(100) NOT NULL COMMENT '业务编号',
  `userId` bigint(20) NOT NULL COMMENT '用户编号',
  `userName` varchar(50) NOT NULL DEFAULT '' COMMENT '用户名称',
  `cardType` tinyint(4) NOT NULL DEFAULT '1' COMMENT '银行卡类别 1 借记卡 2 信用卡',
  `bankCode` varchar(50) NOT NULL COMMENT '银行行别',
  `bankName` varchar(50) DEFAULT NULL COMMENT '绑卡银行',
  `bankCardNo` varchar(50) DEFAULT NULL COMMENT '银行卡号',
  `idCardNo` varchar(50) DEFAULT NULL COMMENT '身份证号',
  `realName` varchar(50) DEFAULT NULL COMMENT '真实姓名',
  `mobile` varchar(50) DEFAULT NULL COMMENT '预留手机号',
  `status` int(1) NOT NULL DEFAULT '-1' COMMENT '绑卡状态 -1 初始化  0 验证成功 1 验证失败 2 处理中',
  `origin` varchar(20) NOT NULL COMMENT '来源:PC/WeChat/Android/IOS',
  `remark` varchar(100) DEFAULT '' COMMENT '付款说明',
  `createTime` datetime NOT NULL COMMENT '创建时间',
  `lastModifyTime` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  `version` int(2) DEFAULT '0' COMMENT '版本号',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='银行卡记录表';

/*Data for the table `t_payment_bank_card_info` */

/*Table structure for table `t_payment_bank_code_dict` */

DROP TABLE IF EXISTS `t_payment_bank_code_dict`;

CREATE TABLE `t_payment_bank_code_dict` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `bankCode` varchar(10) NOT NULL COMMENT '银行编码',
  `bankName` varchar(50) NOT NULL COMMENT '银行名称',
  `keywords` varchar(200) NOT NULL COMMENT '银行名称匹配关键字',
  `createTime` datetime NOT NULL COMMENT '创建时间',
  `lastModifyTime` datetime NOT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `UK_BANKCODE` (`bankCode`)
) ENGINE=InnoDB AUTO_INCREMENT=31 DEFAULT CHARSET=utf8 COMMENT='银行字典表';

