/*Table structure for table `t_payment_channel_quick_agreement` */

DROP TABLE IF EXISTS `t_payment_channel_quick_agreement`;

CREATE TABLE `t_payment_channel_quick_agreement` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `txnId` varchar(50) NOT NULL COMMENT '业务编号',
  `channelCode` varchar(50) NOT NULL COMMENT '渠道编号',
  `channelName` varchar(50) NOT NULL COMMENT '渠道名称',
  `channelSendOrder` varchar(50) NOT NULL COMMENT '鉴权流水',
  `businessType` int(4) NOT NULL DEFAULT '1' COMMENT '鉴权类型 1 独立鉴权 2 快捷支付鉴权',
  `userId` bigint(20) DEFAULT NULL COMMENT '用户编号',
  `userName` varchar(50) DEFAULT NULL COMMENT '用户名称',
  `amount` decimal(18,2) DEFAULT '0.00' COMMENT '消费额度',
  `token` varchar(50) DEFAULT NULL COMMENT '授权编号',
  `validCode` varchar(50) DEFAULT NULL COMMENT '验证码',
  `status` int(4) NOT NULL DEFAULT '-1' COMMENT '验证状态 -1 初始化 0 成功 1 失败 2 处理中',
  `replyCode` varchar(50) DEFAULT NULL COMMENT '返回码',
  `replyMessage` varchar(1000) DEFAULT NULL COMMENT '返回消息',
  `origin` varchar(20) DEFAULT NULL COMMENT '来源:PC/WeChat/Android/IOS',
  `createTime` datetime NOT NULL COMMENT '创建时间',
  `lastModifyTime` datetime NOT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  `identityCode` varchar(50) DEFAULT NULL COMMENT '识别码',
  `version` int(11) DEFAULT '1' COMMENT '版本号',
  `bankCardId` bigint(20) NOT NULL DEFAULT '-1' COMMENT '银行卡编号',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `t_payment_channel_quick_agreement` */

/*Table structure for table `t_payment_permission_restrict` */

DROP TABLE IF EXISTS `t_payment_permission_restrict`;

CREATE TABLE `t_payment_permission_restrict` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `txnId` varchar(100) DEFAULT NULL COMMENT '业务编号',
  `userId` bigint(20) DEFAULT NULL COMMENT '用户编号',
  `userName` varchar(50) DEFAULT '' COMMENT '用户名称',
  `bankCardNo` varchar(50) DEFAULT NULL COMMENT '银行卡编号',
  `businessCode` varchar(50) NOT NULL COMMENT '业务类型',
  `status` int(1) NOT NULL DEFAULT '0' COMMENT '状态  0 启用 1 禁用 ',
  `tips` varchar(100) DEFAULT NULL COMMENT '提示语',
  `remark` varchar(100) DEFAULT '' COMMENT '描述',
  `createTime` datetime NOT NULL COMMENT '创建时间',
  `lastModifyTime` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  `version` int(2) DEFAULT '0' COMMENT '版本号',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='权限限定';

/*Data for the table `t_payment_permission_restrict` */

/*Table structure for table `t_payment_rechage_journal` */

DROP TABLE IF EXISTS `t_payment_rechage_journal`;

CREATE TABLE `t_payment_rechage_journal` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `txnId` varchar(50) NOT NULL COMMENT '业务订单号',
  `channelCode` varchar(50) NOT NULL COMMENT '渠道编号',
  `channelName` varchar(50) NOT NULL COMMENT '渠道名称',
  `channelSendOrder` varchar(50) DEFAULT NULL COMMENT '发送渠道订单号',
  `channelRecvOrder` varchar(100) DEFAULT NULL COMMENT '渠道返回订单号',
  `amount` decimal(18,2) NOT NULL COMMENT '金额',
  `cost` decimal(18,2) DEFAULT NULL COMMENT '手续费',
  `status` int(1) NOT NULL DEFAULT '-1' COMMENT '交易状态 -1初始状态 0 交易成功 1 交易失败 2 处理中',
  `userId` bigint(20) DEFAULT NULL COMMENT '用户ID',
  `userName` varchar(50) DEFAULT NULL COMMENT '用户名',
  `businessCode` varchar(50) DEFAULT '01' COMMENT '业务编号 01 普通充值 04 鉴权申请 05 快捷支付',
  `clientIp` varchar(20) DEFAULT NULL COMMENT '调用方IP(如充值时用户的IP)',
  `actulAmount` decimal(18,2) DEFAULT NULL COMMENT '渠道实际支付金额（到账金额）',
  `remark` varchar(200) DEFAULT NULL COMMENT '订单描述',
  `replyCode` varchar(50) DEFAULT NULL COMMENT '渠道返回码',
  `replyMessage` varchar(1000) DEFAULT NULL COMMENT '渠道返回描述',
  `transTimeout` datetime DEFAULT NULL COMMENT '交易超时时间',
  `sendTime` datetime DEFAULT NULL COMMENT '发送至渠道时间',
  `recvTime` datetime DEFAULT NULL COMMENT '接收渠道返回时间',
  `toAccountTime` datetime DEFAULT NULL COMMENT '到账时间',
  `createTime` datetime NOT NULL COMMENT '创建时间',
  `lastModifyTime` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `version` int(2) NOT NULL DEFAULT '0' COMMENT '版本号',
  `origin` varchar(20) NOT NULL COMMENT '来源:PC/WeChat/Android/IOS',
  `bankCardId` bigint(20) NOT NULL DEFAULT '-1' COMMENT '银行卡编号',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='充值流水表';

/*Data for the table `t_payment_rechage_journal` */

/*Table structure for table `t_payment_withdraw_journal` */

DROP TABLE IF EXISTS `t_payment_withdraw_journal`;

CREATE TABLE `t_payment_withdraw_journal` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `txnId` varchar(50) NOT NULL COMMENT '业务订单号',
  `channelCode` varchar(50) NOT NULL COMMENT '渠道编号',
  `channelName` varchar(50) NOT NULL COMMENT '渠道名称',
  `channelSendOrder` varchar(50) DEFAULT NULL COMMENT '发送渠道订单号',
  `channelRecvOrder` varchar(100) DEFAULT NULL COMMENT '渠道返回订单号',
  `channelSendSerial` varchar(50) DEFAULT NULL COMMENT '批次单笔序列号',
  `businessCode` varchar(50) NOT NULL DEFAULT '01' COMMENT '代付类型 01 代付',
  `userId` bigint(20) DEFAULT NULL COMMENT '用户ID',
  `userName` varchar(50) DEFAULT NULL COMMENT '用户名',
  `amount` decimal(18,2) NOT NULL COMMENT '金额',
  `actulAmount` decimal(18,2) DEFAULT NULL COMMENT '到账金额',
  `cost` decimal(18,2) DEFAULT NULL COMMENT '手续费',
  `status` int(1) NOT NULL DEFAULT '-1' COMMENT '交易状态 -1 初始状态 0 交易成功 1 交易失败 2 交易处理中 3 交易取消 4 银行已收妥 5 已退票',
  `auditStatus` int(4) NOT NULL DEFAULT '-1' COMMENT '审核状态 -1 初始状态 0 审核通过 1 审核不通过 2 无需审核 3 待人工审核',
  `auditdUserId` bigint(20) DEFAULT NULL COMMENT '审核人Id',
  `auditUserName` varchar(20) DEFAULT NULL COMMENT '审核人姓名',
  `auditTime` datetime DEFAULT NULL COMMENT '审核时间',
  `remark` varchar(800) DEFAULT NULL COMMENT '审核意见',
  `replyCode` varchar(50) DEFAULT NULL COMMENT '渠道返回码',
  `replyMessage` varchar(1000) DEFAULT NULL COMMENT '渠道返回描述',
  `sendTime` datetime DEFAULT NULL COMMENT '发送至渠道时间',
  `recvTime` datetime DEFAULT NULL COMMENT '接收渠道返回时间',
  `toAccountTime` datetime DEFAULT NULL COMMENT '到账时间',
  `createTime` datetime NOT NULL COMMENT '创建时间',
  `lastModifyTime` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `origin` varchar(20) DEFAULT NULL COMMENT '来源:PC/WeChat/Android/IOS',
  `version` int(2) NOT NULL DEFAULT '0' COMMENT '版本号',
  `bankCardId` bigint(20) NOT NULL DEFAULT '-1' COMMENT '安全编号',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='代付流水表';

